interface JQuery {
    multiSelect(options?: any) : any;
    multiSelect(element?: string, options?: any) : any;
    multiSelect(element?: string, value?: string, values?: any[]) : any;
    datepicker(options?: any) : any;
    dropify(element?: any, options?: any) : any;
    mask(element: any, options?: any) : any;
}